IF NOT EXISTS (	SELECT	*
				FROM	sys.tables
				WHERE	[name] = 'CountryCode'
				)
BEGIN
	CREATE TABLE [dbo].[CountryCode](
		[CountryCodeId] [bigint] IDENTITY(1,1) NOT NULL,
		[Name] [nvarchar](100) NOT NULL,
		[TwoLetterCode] [nvarchar](2) NOT NULL,
		[ThreeLetterCode] [nvarchar](3) NOT NULL,
		[CreatedOn] [datetime] NOT NULL,
		[CreatedBy] [nvarchar](50) NOT NULL,
		[ModifiedOn] [datetime] NULL,
		[ModifiedBy] [nvarchar](50) NULL,
	 CONSTRAINT [PK_CountryCode] PRIMARY KEY CLUSTERED 
	(
		[CountryCodeId] ASC
	)WITH (PAD_INDEX = OFF, STATISTICS_NORECOMPUTE = OFF, IGNORE_DUP_KEY = OFF, ALLOW_ROW_LOCKS = ON, ALLOW_PAGE_LOCKS = ON) ON [PRIMARY]
	) ON [PRIMARY]
END
GO


